-- ----------------------------
-- Table structure for bs_certificate
-- ----------------------------
DROP TABLE IF EXISTS `bs_certificate`;
CREATE TABLE `bs_certificate` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `ca_id` bigint DEFAULT NULL COMMENT 'ca id',
  `certificate_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '证书名称',
  `key_size` int DEFAULT NULL COMMENT '证书密钥长度',
  `certificate_issuer` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '证书签发者',
  `certificate_subject` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '证书使用者',
  `start_date` datetime DEFAULT NULL COMMENT '证书开始时间',
  `expire_date` datetime DEFAULT NULL COMMENT '证书过期时间',
  `certificate_status` int DEFAULT NULL COMMENT '证书状态(0:request pending证书请求,1:active证书有效,2:expired 证书过期,3:unknown未知)',
  `certificate_purpose` int DEFAULT NULL COMMENT '证书目的(0:证书请求,1:服务端认证,2:客户端认证,3:客户端和服务端认证)',
  `certificate_content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '证书内容',
  `private_key` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '证书密钥',
  `keystore_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'keystore类型(JKS或者SWKS)',
  `keystore_content` text COLLATE utf8mb4_bin COMMENT 'keystore 内容',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='证书表';

